package com.csg.androidexam;

import android.support.v7.app.AppCompatActivity;
import android.os.Bundle;

import java.util.ArrayList;
import java.util.List;

public class ThirdExamActivity extends AppCompatActivity {

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_third_exam);


        ArrayList<Model> modelList = new ArrayList<>();
        modelList.add(new Model("data:image/jpeg;base64,", "Final Score", "Action"));
        modelList.add(new Model("data:image/jpeg;base64,", "First Man", "Drama"));
        modelList.add(new Model("data:image/jpeg;base64,", "Funny Girl - The musical", "Musical"));
        modelList.add(new Model("data:image/jpeg;base64,", "Grans", "Drama"));

        MovieThirdFragment movieThirdFragment = MovieThirdFragment.newInstance(modelList);

        getSupportFragmentManager().beginTransaction()
                .replace(R.id.container, movieThirdFragment)
                .commit();

    }
}
